import React, { Component } from "react";

class InputSignIn extends Component {
  render() {
    return (
      <>
        <div className="col-12">
          <h1>CREATE YOUR ACCOUNT</h1>
        </div>
        <div className="col-12">
          <div className="step" id="step1">
            <div className="node">1</div>
          </div>
        </div>
      </>
    );
  }
}

export default InputSignIn;
